import PartidaDefault from '../Partidas/PartidaDefault';
import Partida4x4 from './Partida4x4';

class PartidaFactory {

    createPartida(tipo) {
        let partida = null;
        switch (tipo) {
            case "default":
                partida = new PartidaDefault();
                break;
            case "4P":
                partida = new Partida4x4();
                break;
            default:
                break;
        }
        return partida;
    }

}

export default PartidaFactory;
